import React, {Component} from 'react';
import axios from 'axios';

const Description = props => (
    <tr>
        <td>{props.description.context}</td>
        <td>{props.description.id}</td>
        <td>{props.description.title}</td>
        <td>{props.description.securityDefinitions}</td>
        <td>{props.description.security}</td>
        <td>{props.description.properties}</td>
        <td>{props.description.actions}</td>
        <td>{props.description.events}</td>
    </tr>
)

export default class ReadDesc extends Component {

    constructor(props) {
        super(props);
        this.state = {description: []};
        this._isMounted = false;
    }

    componentWillUnmount() {
        this._isMounted = false;
    }

    componentDidMount() {

        axios.get('http://localhost:4000/td/'+this.props.match.params.id)
        .then(response => {
            this.setState({
                description: response.data
            })
        })
        .catch(function(error) {
            console.log(error)
        })

        this._isMounted = true;
    }

    descriptionList() {
        return this.state.description.map(function(currentDescription, i) {
            return <Description description={currentDescription} key={i} />;
        });
    }

    render() {
        return (
            <div style={{ marginTop: 20 }}>
                <h3>Cat√°logo</h3>
            </div>
        )
    }
}
